import {Link} from 'react-router-dom';

function Login(){
    return(
        <div>
        <h1>TODO Login Application</h1>
        <br/>
        <h2>
            <Link to="/Home">Login</Link>
        </h2>
        <br/>
        <h2>
            <Link to="/SignUp">SignUp</Link>
        </h2>
    </div>
    )
}

export default Login;
